import React from 'react';
import FormComponent4 from '../components/FormComponent4';

const subjectsData = [
  {
    title: "MICR 201 Apllied Microbiology and Infection Control Including Safety",
    credits: 3,
    maxIA: 25,
    maxSE: 75,
  },
  {
    title: "N-AHN(1) 215 Adult Health (Medical Surgical) Nursing I (Theory)",
    credits: 7,
    maxIA: 25,
    maxSE: 75,
  },
  {
    title: "N-AHN(1) 215 Adult Health (Medical Surgical) Nursing I (Practical)",
    credits: 7,
    maxIA: 50,
    maxSE: 50,
  },

];

const Paragraph7 = () => {
  return (
    <FormComponent4
      title="First Year B.Sc. Nursing Marks Memo 4YDC"
      subjectsData={subjectsData}
    />
  );
};

export default Paragraph7;
